import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Profile: React.FC = () => {
  const [user, setUser] = useState<any>(null);
  const [isEditing, setIsEditing] = useState(false);
  const [editedUser, setEditedUser] = useState<any>(null);
  const navigate = useNavigate();

  useEffect(() => {
    const storedUserData = localStorage.getItem('userData');
    if (storedUserData) {
      const parsedData = JSON.parse(storedUserData);
      setUser(parsedData);
      setEditedUser(parsedData); // Инициализация данных для редактирования
    } else {
      navigate('/login');
    }
  }, [navigate]);

  if (!user) {
    return <div>Загрузка...</div>;
  }

  // Функция для открытия и закрытия редактора данных
  const toggleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Функция для изменения данных пользователя
  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setEditedUser({ ...editedUser, [e.target.name]: e.target.value });
  };

  // Функция для сохранения измененных данных
  const handleSave = () => {
    localStorage.setItem('userData', JSON.stringify(editedUser));
    setUser(editedUser); // Обновление состояния пользователя
    toggleEdit(); // Закрытие редактора
  };

  return (
    <div className="min-h-screen bg-gray-100 py-8 px-4">
      <div className="max-w-lg mx-auto bg-white p-6 rounded-lg shadow-lg">
        <h1 className="text-3xl font-semibold text-center text-gray-800 mb-6">Личный кабинет</h1>

        {/* Информация о пользователе */}
        <div className="mb-6">
          <h2 className="text-xl font-medium text-gray-700 mb-4">Информация о пользователе</h2>
          <div className="bg-gray-50 p-4 rounded-lg shadow-inner">
            <p className="text-lg"><strong>Имя:</strong> {user.name}</p>
            <p className="text-lg mt-2"><strong>Email:</strong> {user.email}</p>
          </div>
        </div>

        {/* Статус подписки */}
        <div className="mb-6">
          <h2 className="text-xl font-medium text-gray-700 mb-4">Статус подписки</h2>
          <div className="bg-gray-50 p-4 rounded-lg shadow-inner">
            <p className="text-lg"><strong>Подписка:</strong> {user.subscriptionPlan}</p>
            <p className="text-lg mt-2"><strong>Статус:</strong> {user.subscriptionStatus}</p>
            <p className="text-lg mt-2"><strong>Окончание подписки:</strong> {user.subscriptionEndDate}</p>
          </div>
        </div>

        {/* Кнопка для изменения данных */}
        <div className="text-center mb-4">
          <button
            onClick={toggleEdit}
            className="px-6 py-2 bg-blue-600 text-white rounded hover:bg-blue-700 transition-colors"
          >
            {isEditing ? 'Отменить' : 'Изменить данные'}
          </button>
        </div>

        {/* Модальное окно для редактирования данных */}
        {isEditing && (
          <div className="bg-gray-50 p-4 rounded-lg shadow-inner">
            <h2 className="text-xl font-medium text-gray-700 mb-4">Редактирование данных</h2>
            <div className="mb-4">
              <label className="block text-gray-700">Имя:</label>
              <input
                type="text"
                name="name"
                value={editedUser.name}
                onChange={handleChange}
                className="w-full p-2 border border-gray-300 rounded"
              />
            </div>
            <div className="mb-4">
              <label className="block text-gray-700">Email:</label>
              <input
                type="email"
                name="email"
                value={editedUser.email}
                onChange={handleChange}
                className="w-full p-2 border border-gray-300 rounded"
              />
            </div>
            <div className="text-center">
              <button
                onClick={handleSave}
                className="px-6 py-2 bg-green-600 text-white rounded hover:bg-green-700 transition-colors"
              >
                Сохранить
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Profile;
